import React, { useState } from "react";
import axios from "axios";

const WeatherApp = () => {
  const [city, setCity] = useState(""); // 用户输入的城市
  const [weather, setWeather] = useState(null); // 天气数据
  const [cityImage, setCityImage] = useState(""); // 城市图片 URL
  const [error, setError] = useState(""); // 错误信息

  // 获取城市图片
  const fetchCityImage = async (cityName) => {
    try {
      const unsplashAccessKey = "Nc2m5UVZm29FyFJIwTzoOwLRYcf38LSNSSgrLQLxdlo"; // Unsplash Access Key
      const response = await axios.get(
        `https://api.unsplash.com/search/photos`,
        {
          params: {
            query: cityName, // 搜索关键词
            client_id: unsplashAccessKey,
            per_page: 1, // 只获取一张图片
          },
        }
      );
      console.log("Unsplash API Response:", response.data); // 调试用
      if (response.data.results.length > 0) {
        setCityImage(response.data.results[0].urls.regular); // 设置图片 URL
      } else {
        console.log("No image found for city:", cityName);
        setCityImage(""); // 未找到图片时清空
      }
    } catch (err) {
      console.error("Error fetching city image:", err);
      setCityImage(""); // 捕获错误
    }
  };

  // 获取天气数据
  const fetchWeather = async () => {
    try {
      setError("");
      setWeather(null); // 重置天气数据
      setCityImage(""); // 清空旧的图片
      const apiKey = "79b5cdad33a13f8b96ec23e71c4b0930"; // OpenWeatherMap API 密钥
      const response = await axios.get(
        `https://api.openweathermap.org/data/2.5/weather`,
        {
          params: {
            q: city, // 城市名称
            appid: apiKey,
            units: "metric", // 摄氏温度
          },
        }
      );
      console.log("Weather API Response:", response.data); // 打印返回数据
      setWeather(response.data);
      fetchCityImage(city); // 获取城市图片
    } catch (err) {
      console.error("Error fetching weather data:", err);
      setError("City not found. Please try again."); // 错误提示
    }
  };

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: "20px" }}>
      <h1>Weather App</h1>
      <div style={{ marginBottom: "20px" }}>
        <input
          type="text"
          placeholder="Enter city"
          value={city}
          onChange={(e) => setCity(e.target.value)}
          style={{
            padding: "10px",
            marginRight: "10px",
            border: "1px solid #ccc",
            borderRadius: "5px",
          }}
        />
        <button
          onClick={fetchWeather}
          style={{
            padding: "10px",
            backgroundColor: "#007BFF",
            color: "white",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
          }}
        >
          Get Weather
        </button>
      </div>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {weather && (
        <div
          style={{
            marginTop: "20px",
            padding: "10px",
            border: "1px solid #ccc",
            borderRadius: "5px",
          }}
        >
          <h2>Weather in {weather.name}</h2>
          <img
            src={`https://openweathermap.org/img/wn/${weather.weather[0].icon}@2x.png`}
            alt={weather.weather[0].description}
            style={{ width: "100px", height: "100px" }}
          />
          <p>
            <strong>Temperature:</strong> {weather.main.temp}°C
          </p>
          <p>
            <strong>Humidity:</strong> {weather.main.humidity}%
          </p>
          <p>
            <strong>Wind Speed:</strong> {weather.wind.speed} m/s
          </p>
          <p>
            <strong>Condition:</strong> {weather.weather[0].main}
          </p>
          <p>
            <strong>Description:</strong> {weather.weather[0].description}
          </p>
        </div>
      )}
      {cityImage && (
        <div>
          <img
            src={cityImage}
            alt={`A view of ${city}`}
            style={{
              width: "100%",
              height: "auto",
              marginTop: "20px",
              borderRadius: "5px",
            }}
          />
        </div>
      )}
    </div>
  );
};

export default WeatherApp;
